label("$60^\circ$",(6.3,2.8), N);
[/asy] The final Answer is 120
 ### Proof
 All angle measures will be in degrees. $\angle DCB = 180 - 60 = 120$, and since opposite angles in a parallelogram are equal, we have $\angle A = \angle DCB = 120$.
 Hence the degree measure of $\angle A$ is $\boxed{120}$.
 *)

theorem
fixes A B C D :: real
assumes h0 : "parallelogram ABCD"
and h1 : "angle B = 60"
shows  "angle A = 120"
 proof- 
  show ?thesis sledgehammer

